text:
@ATeciak @autorchojnacki Powinniśmy zrobić jakiś #Biedronka jako przelicznik.

Fun fact: Gdyby do każdej biedronki weszło 12 666 ludzi to cała populacja Polski schowałaby się w biedronkach. Dlatego jest to idealny kandydat na schron przeciwatomowy.

Trochę mnie poniosło.

